import React from 'react'
import ReactDOM from 'react-dom'
import './index.css'
import "../node_modules/video-react/dist/video-react.css"

import {TopBar} from './react-top-bar'
import {Player, ControlBar} from 'video-react'



const displayContents = {
    name: "Shed Studio",
    description: "Custom multimedia marketing packages tailored to you",
    avatarUrl: "https://res.cloudinary.com/dwtivbec9/image/upload/v1542456067/jake-walker-1155669-unsplash.jpg",
    email: "shedthestudio@gmail.com",
    social: {
        facebook: "https://facebook.com",
        instagram: "https://instagram.com",
        youtube: "https://youtube.com"
    }

}
class App extends React.Component
{
    constructor(props)
    {
        super(props)
        this.state = displayContents
    }

    render()
    {
        return(
            <div id="page-wrapper">
            <TopBar {...this.state} />
            <Player
            id="hero-player"
            height="10"
            src="https://media.w3.org/2010/05/sintel/trailer_hd.mp4"
            muted={true}
            autoPlay={true}
            playsInine={true}
            aspectRation="16:9" >

            <ControlBar
            disableCompletely={true}
            />
            </Player>
           </div>
        )
    }
}

ReactDOM.render(<App />,
                document.getElementById('root'))
